pragma solidity ^0.4.0;

import './Registrar.sol';

contract LearnerLearningProvider {

    struct LearningRecord {
        string queryResultHash;
        string queryHash;
    }

    struct Permissions {
        bool canRead;
        bool canWrite;
        bool canGrant;
    }

    address owner;
    mapping(address => Permissions) public permissions;
    LearningRecord[] learningRecords;
    string recordType;
    address provider;

    function getOwner() public view returns (address) {
        return owner;
    }

    function getRecordType() public view returns (string) {
        return recordType;
    }

    function getProvider() public view returns (address) {
        return provider;
    }

    function LearnerLearningProvider(address _owner, address _learner, 
    string _queryString, string _queryResult, string _recordType) public {
        owner = _owner;
        recordType = _recordType;
        learningRecords.push(LearningRecord(_queryResult, _queryString));
        Permissions memory perm = permissions[_learner];
        perm.canGrant = true;
        perm.canRead = true;
        perm.canWrite = true;
        permissions[_learner] = perm;
        Permissions memory permp = permissions[msg.sender];
        permp.canGrant = true;
        permp.canRead = true;
        permp.canWrite = true;
        permissions[msg.sender] = permp;
    }

    function insertLearningRecord(string queryString, string queryResultHash) public payable {
        if (permissions[msg.sender].canWrite) {
            learningRecords.push(LearningRecord(queryResultHash, queryString));
        }
    }


    function grantAccess(address registrarAddress, address participantAddress,address indexContract, bool read, bool write, bool admin) public payable returns (bool) {
        if (permissions[msg.sender].canGrant ) {
            Permissions memory perm = permissions[participantAddress];
            perm.canGrant = admin;
            perm.canRead = read;
            perm.canWrite = write;
            permissions[participantAddress] = perm;
            return true;
        }else {
            return false;
        }
    }

    function getLearningRecordsCount() public view returns (uint) {
        if (permissions[msg.sender].canRead) {
            return learningRecords.length;
        }else {
            return 0;
        }
    }

    function getLearningRecord(uint index) public view returns (string, string, string) {
        if (permissions[msg.sender].canRead) {
            return (recordType, learningRecords[index].queryResultHash,learningRecords[index].queryHash);
        }
    }

    function canGrant(address participantAddress) public constant returns (bool) {
        return permissions[participantAddress].canGrant;
    }

    function canWrite(address participantAddress) public constant returns (bool) {
        return permissions[participantAddress].canWrite;
    }

    function canRead(address participantAddress) public constant returns (bool) {
        return permissions[participantAddress].canRead;
    }
}
